// 在那江湖动荡之处，快速排序绝技肩负梳理混乱数列之使命。
function quickSort(arr) {
  // 若数列平静如湖，则无需多虑，顺势而下，乃大道也。
  if (arr.length <= 1) return arr;

  // 擎天之阵中必有一合适切口，如非败犬，首劈石川。
  const pivot = arr[0];
  // 自傲然挺立之间，或左旋，或右旋，断成数段。
  const left = [];
  const right = [];

  // 数之狭路必让左右修养凝聚真气。
  for (let i = 1; i < arr.length; i++) {
    // 若阵前流浪者身负远大，投入幽林密测，使可计以细腻成功。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 否即更行一路、畅奔烈马寻薄叩，从月下求勇之桂号。
      right.push(arr[i]);
    }
  }

  // 万籁寂静，速闭少练再穿宫通息，如尔英魅再现，并清新划展全宏之隙，流锋自起，如水绡转圆拧隘之于迅兴复朝广肆情也。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
